       function initMap() {
        const map = new google.maps.Map(document.getElementById("map"), {
          zoom: 6,
          center: { lat: 26.894330661290653, lng: 75.75532482747644 },
        });
		  
     
			  
var locations = [
      ['Ess Kay Fincorp Limited, G-1 & G-2 , Adarsh Plaza Khasa Khoti Circle, Station Rd, Gopalbari, Jaipur', 26.894330661290653, 75.75532482747644, 4],
      ['Ess Kay Fincorp Limited, G-1 & G-2 , Adarsh Plaza Khasa Khoti Circle, Station Rd, Gopalbari, Jaipur', 26, 76, 5],

      ['Ess Kay Fincorp Limited, G-1 & G-2 , Adarsh Plaza Khasa Khoti Circle, Station Rd, Gopalbari, Jaipur', 30.8943306612906538, 79.755324827476442, 1]
    ];
	
	
	var infowindow = new google.maps.InfoWindow();

    var marker, i;

    for (i = 0; i < locations.length; i++) {  
      marker = new google.maps.Marker({
        position: new google.maps.LatLng(locations[i][1], locations[i][2]),
        map: map
      });

      google.maps.event.addListener(marker, 'click', (function(marker, i) {
        return function() {
          infowindow.setContent(locations[i][0]);
          infowindow.open(map, marker);
        }
      })(marker, i));
    }
	
		// Construct the polygon.
var BucaramangaPolygon = new google.maps.Polygon({
    paths: BucaramangaDelimiters,
    strokeColor: '#FF37FF',
    strokeOpacity: 0.8,
    strokeWeight: 3,
    fillColor: '#003702',
    fillOpacity: 0.75
});


// Draw the polygon on the desired map instance
BucaramangaPolygon.setMap(map);
		
      }

      // Attaches an info window to a marker with the provided message. When the
      // marker is clicked, the info window will open with the secret message.
      function attachSecretMessage(marker, secretMessage) {
        const infowindow = new google.maps.InfoWindow({
          content: secretMessage,
        });
        marker.addListener("click", () => {
          infowindow.open(marker.get("map"), marker);
        });
      }
